import React from 'react';
import {Switch , Route} from 'react-router-dom';
import HomePage from './pages/home-page/home-page.component';

class App extends React.Component {
  state = {
    currentUser : null
  };

  render() {
    return(
      <div className="App">
        <Switch>
          <Route exact path="/" component = {HomePage}/>
        </Switch>
      </div>
    )
  }
}
export default App;
